La Sudirman Cup est le championnat du monde de badminton par équipes mixtes. Cette compétition tient son nom de (en) fondateur et ancien président de la fédération indonésienne. Elle a lieu tous les 2 ans, les années impaires, tandis que la Thomas Cup et l'Uber Cup ont lieu les années paires. Il n'y a pas de dotation financière pour les vainqueurs, seulement le prestige de représenter son pays. Les joueurs gagnent néanmoins des points pour le classement mondial de la BWF. La première édition a eu lieu au Bung Karno Stadium à Jakarta (Indonésie) en mai 1989. D'autres compétitions par équipes existent, mais elles ne sont pas mixtes : 
* la Thomas Cup ou championnat du monde de badminton par équipes masculines, depuis 1949 ; 
* l'Uber Cup ou championnat du monde de badminton par équipes féminines, depuis 1957.
